import React from 'react'

const TableList = ({ list }) => {
    return (
        <div className="todo-list-container">
          {list.map((todo) => (
            <T item={todo} key={todo.id} toggleTodo={toggleTodo} />
          ))}
        </div>
      );
    };

export default TableList
